			"on_talk": "[swallow_event(),speech_dialog(
													
												self,
												[~Oh, I was just sitting down for a bite to eat.\\nCare to join us?~],
												level.player,
												set(level.player.animation, 'emote_confused'),
												[~Uh, maybe...\\nI certainly appreciate the hospitality!~],
												set(level.player.animation, 'emote_confused'),
												[~So is this some kind of dining area?~],
												self,
												[~Yes, it is.  We have regular meal service\\nfor those who are off-duty.~],
												[~Gaston should be coming out any minute now,\\nwith a lovely bit of smoked salmon.~],
												[~Well, pretty soon, I hope.\\nSometimes he takes a while.~],
												level.player,
												set(level.player.animation, 'emote_raisedfinger'),
												[~That sounds pretty classy.~],
												self,
												[~Yeah, small perks like that make life nice.~],
												level.player,
												set(level.player.animation, 'emote_confused'),
												[~So what is it you do for a, uh... job?~],
												self,
												[~Basic labor, mostly.\\nI haul construction materials around.~],
												[~We're still working on the north tower.\\nBe careful if you venture out there.~],
												[~It's easy to accidentally fall.\\nIt's not really pedestrian-ready yet.~],
												level.player,
												set(level.player.animation, 'emote_nod'),
												[~I'll keep that in mind, thanks.~]
												)]",
