			"face_right": 1,
			"label": "_7e886efc",
			"on_talk": "[swallow_event(),speech_dialog(
												level.player,
												set(level.player.animation, 'emote_raisedfinger'),
												[~Hi there, what's going on?~],
												self,
												[~Oh, hello.\\nI'm just eating some fruit.~],
												[~Are you that green guy security is after?~],
												level.player,
												set(level.player.animation, 'emote_confused'),
												[~If I answer yes,\\nare you going to call them in here?~],
												self,
												[~No, I'm not looking for trouble.~],
												[~Besides which, you don't seem like a bad guy,\\nif you ask my opinion.~],
												[~Not that anyone's asking me.~],
												level.player,
												[~Well, thanks, I do appreciate that.~],
												set(level.player.animation, 'emote_raisedfinger'),
												[~Speaking of which, color me curious,\\nbut I thought that cats were carnivores?~],
												set(level.player.animation, 'emote_confused'),
												[~How is it that you're able to eat fruit?~],
												self,
												[~Oh! I guess you wouldn't know these things...\\nI suppose we take that for granted.~],
												[~See, strictly speaking, we're not cats.\\nWe're simply made to look like them.~],
												level.player,
												set(level.player.animation, 'emote_confused'),
												[~Er... \"made to\", you say?\\nThat's an interesting choice of words.~],
												self,
												[~Yes, that's right - I'm implying we are \"made\".\\nWe're made, not born, like you ... presumably are.~],
												level.player,
												set(level.player.animation, 'emote_confused'),
												[~...~],
												set(level.player.animation, 'emote_geez'),
												[~Okay ... I'm kind of at a loss for words.\\nThat seems pretty unbelievable.~],
												set(level.player.animation, 'emote_oh'),
												[~Then again, the world is nothing\\nif not full of surprises.~],
												set(level.player.animation, 'emote_confused'),
												[~So you're made, you say...\\nWho, then, is your maker?~],
												self,
												[~Oh, Milgram, of course.\\nWhy else would he be so important?~],
												[~I confess, I really don't know -how-\\nhe creates us,  but I know that he does.~],
												level.player,
												set(level.player.animation, 'emote_confused'),
												[~So then... are you robots or something?~],
												self,
												[~Of course not!  Robots don't eat.\\nWe're all living creatures.~],
												level.player,
												set(level.player.animation, 'emote_raisedfinger'),
												[~Oh, so he's your parent, then?\\nAnd just has a lot of kids.~],
												self,
												[~Well, I guess we consider him a parent,\\nbut we're very much made.~],
												[~He chooses what we're shaped like, for one thing.\\nUsually takes inspiration from the animal kingdom.~],
												[~He fancies himself an artist in this regard,\\nand for ego's sake I'm not about to disagree.~],
												[~These days, moreover, we're mass-produced.\\nThere's a factory downstairs that churns out\\nthe more successful designs.~],
												level.player,
												set(level.player.animation, 'emote_oh'),
												[~But that's just CRAZY!\\nHow does that even work?!  Magic?~],
												self,
												[~Like I said, I really don't know, myself.~],
												[~But it's not any crazier than\\nyou transforming from a tadpole.~],
												[~I mean, that seems pretty incredible\\nfrom my perspective.~],
												[~But that is how it works for frogs, right?~],
												level.player,
												set(level.player.animation, 'emote_confused'),
												[~It is.\\nIt's just a crazy world we live in, huh?~],
												self,
												[~Madness and wonder every step of the way.~],
												level.player,
												set(level.player.animation, 'emote_nod'),
												[~No kidding.  Well, hey, have a nice meal.\\nThanks for all the info.~],
												self,
												[~No problem.~]
												)]",
